export class EasyTempStorage{#content_obj={};constructor(){this.#content_obj={}}setKey(key,value){this.#content_obj[key]=value}getKey(key,default_val=""){return Object.prototype.hasOwnProperty.call(this.#content_obj,key)?this.#content_obj[key]:default_val}hasKey(key){return Object.prototype.hasOwnProperty.call(this.#content_obj,key)}removeKey(key){delete this.#content_obj[key]}deleteAll(){this.#content_obj={}}printAllKeys(){console.log("Temporary Storage Contents:",JSON.stringify(this.#content_obj,null,2))}getAllKeys(stringify=false){const keys=Object.keys(this.#content_obj);return stringify?JSON.stringify(keys):keys}}
